/* VCD dumping functions */
MOD_mkTb_DMA & mkTb_DMA_backing(tSimStateHdl simHdl)
{
  static MOD_mkTb_DMA *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkTb_DMA(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkTb_DMA::dump_VCD_defs()
{
  (mkTb_DMA_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkTb_DMA::dump_VCD(tVCDDumpType dt)
{
  (mkTb_DMA_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkTb_DMA_backing(sim_hdl));
}
